The nthawi kusiyana m'manja akupanga flowmeter utenga ntchito mfundo ya nthawi kusiyana njira, ndi kachipangizo chubu ndi clamped kunja, popanda kufunika kwa interception kapena kusagwirizana.Ndiosavuta kukhazikitsa, komanso yosavuta kuyiyika ndikuyikonza.Masensa atatu, akuluakulu, apakati, ndi ang'onoang'ono amatha kuyeza mapaipi wamba amitundu yosiyanasiyana.Chifukwa cha kukula kwake kochepa, kusuntha kosavuta, ndikuyika mofulumira, imagwiritsidwa ntchito kwambiri poyesa mafoni, kuyeza ndi kuyesa, kuyerekezera deta, ndi zochitika zina.
Makhalidwe aukadaulo:
â— Kukula kochepa, kosavuta kunyamula;
â— Kusungirako deta komwe kumapangidwira;
â— Kutentha kwamadzimadzi oyezera ndi -40 â„ƒ~+260 â„ƒ;
â— Non kukhudzana unsembe kunja popanda kufunika kutsekereza kapena chitoliro breakage;
â— Yoyenera bidirectional flow velocity kuyeza kuchokera ku 0.01m/s mpaka 12m/s.
â— Kumangidwa mu batri ya lithiamu yowonjezereka, batire yokwanira imatha kugwira ntchito mosalekeza kwa maola 14;
â— Chiwonetsero cha mizere inayi, chomwe chimatha kusonyeza kuchuluka kwa kayendetsedwe kake, kuthamanga kwachangu, kuthamanga kwachangu, ndi mawonekedwe ogwiritsira ntchito zida pa sikirini imodzi;
â— Posankha mitundu yosiyanasiyana ya masensa, ndizotheka kuyeza kuthamanga kwa mapaipi ndi DN20-DN6000;
Nthawi yotumiza: May-30-2024

